<script>
  const comunas = document.querySelectorAll('.comuna');
  const nombreComuna = document.getElementById('nombreComuna');

  comunas.forEach(comuna => {
    comuna.addEventListener('click', () => {
      comunas.forEach(c => c.classList.remove('activa'));
      comuna.classList.add('activa');
      nombreComuna.style.display = 'block';
      nombreComuna.textContent = comuna.id.toUpperCase();
    });
  });
</script>
